    data: |
      SELECT DISTINCT 57 * + cor1.col2 - + cor0.col1 * + 33 AS col0 FROM tab0 (FORMAT parquet) cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

